clear all
%%
%[text] ## Zadatak
load T_finalna_korelacija.mat
disp (T_finalna_korelacija) %[output:0357112e]
X= table2array(T_finalna_korelacija(:,1:10)) %[output:0195b788]
Y= table2array(T_finalna_korelacija(:,end)) %[output:6536570e]

%%
%[text] ## Optimizacija hiperparametara
struct_hyper_opt=struct('UseParallel',true,'Optimizer','bayesopt','AcquisitionFunctionName','expected-improvement-per-second-plus','Repartition',true,'ShowPlots',false,'Verbose',1,'MaxObjectiveEvaluations',500);

%%
%[text] ## Random forest
predictorNames={'immunity proxy deaths','stringency','pop_density','cardiovasc','diabetes','onset','PCA starost','PCA vakcinacija','PCA-GHSI-1','PCA-GHSI-2','PCA-GHSI-3','PCA mobilnost-1','PCA mobilnost-2','PCA mobilnost-3'};
responseName= 'R_mean' %[output:1b19bb5e]
Mdl=fitrensemble(X,Y,"ResponseName",responseName,"PredictorNames",predictorNames,OptimizeHyperparameters={'MinLeafSize','MaxNumSplits'},Method="Bag",hyperparameterOptimizationOptions=struct_hyper_opt,NumLearningCycles=500)
save('Mdl.mat',"Mdl")
%%
%[text] ## Znacaj prediktora
prediction=predictorImportance(Mdl) %[output:1ca8fd04]
figure; %[output:18843e2b]
bar(prediction) %[output:18843e2b]
set(gca,'XTickLabel',predictorNames,'XTick',1:numel(predictorNames)) %[output:18843e2b]
xlabel('Prediktori') %[output:18843e2b]
ylabel('Značaj') %[output:18843e2b]
[~,sortedIdx]=sort(prediction,'descend') %[output:6e483112]

figure; %[output:0728bed4]
subplot(1,3,1) %[output:0728bed4]
plotPartialDependence(Mdl,sortedIdx(1),X) %[output:0728bed4]
subplot(1,3,2) %[output:0728bed4]
plotPartialDependence(Mdl,sortedIdx(2),X) %[output:0728bed4]
subplot(1,3,3) %[output:0728bed4]
plotPartialDependence(Mdl,sortedIdx(3),X) %[output:0728bed4]
%%
top2=sortedIdx(1:2) %[output:3c824f53]
[f,x,x1]=partialDependence(Mdl,top2,X) %[output:4ee45767] %[output:3c455394] %[output:79bc4d00]
%%
%[text] ## 2D vizuelizacija zavisnosti
figure; %[output:1b19e3c1]
imagesc(x,x1,f') %[output:1b19e3c1]
set(gca,'YDir','normal') %[output:1b19e3c1]
colorbar; %[output:1b19e3c1]
xlabel(sprintf(predictorNames{sortedIdx(1)})) %[output:1b19e3c1]
ylabel(sprintf(predictorNames{sortedIdx(2)})) %[output:1b19e3c1]
title('Parcijalna zavisnost(2 najznačajnija prediktora)') %[output:1b19e3c1]
%%
%[text] ## 3D vizuelizacija zavisnosti
[X1,X2]=meshgrid(x,x1) %[output:6530b126] %[output:77e1865f]
F=f' %[output:5f09836b]
figure; %[output:86336c35]
surf(X1,X2,F,'EdgeColor','none') %[output:86336c35]
colorbar; %[output:86336c35]
xlabel(sprintf(predictorNames{sortedIdx(1)})) %[output:86336c35]
ylabel(sprintf(predictorNames{sortedIdx(2)})) %[output:86336c35]
zlabel('Predikcija') %[output:86336c35]
title ('Parcijalna zavisnost (2 najznačajnija prediktora)') %[output:86336c35]







